export default function Icon({
  iconName,
  withGradient,
  gradientColor = 'blue',
  iconConfig,
  gradientClassName,
}: {
  iconName: string;
  withGradient?: boolean;
  iconConfig?: IconProps;
  gradientColor?: 'default' | 'pink' | 'blue' | 'green' | 'rainbow';
  gradientClassName?: string;
}) {
  const Icon = icons[iconName as keyof typeof icons] || null;
  return (
    <>
      {withGradient ? (
        <GradientBorder
          gradient={gradientColor}
          className={cn(
            'h-10 w-10 flex justify-center items-center m-[.4px]',
            gradientClassName
          )}
        >
          <Icon />
        </GradientBorder>
      ) : (
        <Icon {...iconConfig} />
      )}
    </>
  );
}
